import React from 'react'
import { useHistory } from 'react-router-dom'

function Header() {
    let history = useHistory();
    return (
        <header>
            <ul>
                <li onClick={() => history.push("/")}>Home</li>
            </ul>
            <i class="fa fa-shopping-cart" aria-hidden="true"></i>
        </header>
    )
}

export default Header
